import React, { useRef } from 'react';
// Components
import { IngredientCreationForm } from './components/IngredientCreationForm';

import { ingredients } from '../pizzaData';

export const IngredientsListPage = () => {



  return (
    <>
      <section>
        <h3>Доступные ингредиенты</h3>
        <p>
          {ingredients
            .reduce((acc: string[], cur) => {
              acc.push(cur.name);
              return acc;
            }, [])
            .join(', ')}
        </p>
        <div>
          <form name='becon'>
            <label>Бекон</label>
            <button onClick={() => null}>Редактировать</button>
            <button onClick={() => null}>Удалить</button>
          </form>
        </div>
      </section>
      <section>
        <h3>Это будет новый ингредиент</h3>
        <p>
          <IngredientCreationForm />
        </p>
      </section>
    </>
  );
};
